import React from "react";
import './styles/account.css';
import Header from "../components/Header";
import Footer from "../components/Footer";

const Account = () => {
    return(
        <div className='Account'>
            <Header/>
            <div className='Account-block'>
                <div className=' Account-nav bg-light50'>
                    <button className='Account-nav-button Button-text-link-1'>Особистий кабінет</button>
                    <button className='Account-nav-button Button-text-link-1'>Страховка</button>
                    <button className='Account-nav-button Button-text-link-1'>Дані аккаунту</button>
                    <a className='Account-nav-button-link Button-text-link-1' href='/logIn' >Пацієнти</a>
                </div>
                <div className='Account-inf bg-lightF'>

                </div>
            </div>
            <Footer/>
        </div>
    )
}
export default Account;
